import './../styles/hero.css';
import heroImage from './../img/ei_1698403530166-removebg-preview.png';

const Hero = () => {
  return (
    <section className="hero-section" id="hero-section">
      <div className="hero-container">
        <div className="info">
          <h1>Terlaris</h1>
          <h3>Lenovo Thinkpad 08</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Laboriosam a deleniti consequatur inventore eos, natus.</p>
          <button>Buy Now</button>
        </div>
        <figure className="hero-image">
          <img src={heroImage} alt="Laptop"/>
        </figure>
      </div>
    </section>
  );
}

export default Hero;
